import AufgabenListeItem from './AufgabenListeItem'

const AufgabenListe=(props)=>{
    return (
        <div>
            <h3>Noch zu erledigen</h3>
            <ul>
                {props.aufgaben.map((element,index) => {
                    return <AufgabenListeItem aufgabe={element} key={index} löschHandler={props.löschHandler}/>

                  })
                }
            </ul> 
        </div>
    )
}

export default AufgabenListe;
